function actualizarVisualMarca(nombreMarca) {
    const contenedor = document.getElementById('contenedor-marca-dinamica');
    const input = document.getElementById('Operadora');
    const imgLogo = document.getElementById('img-logo-dinamico');

    // 1. Resetear estilos anteriores (limpiar clases viejas)
    contenedor.className = 'caja-marca-neutra'; 
    input.value = nombreMarca;

    // 2. Buscar si tenemos configuraci√≥n para esta marca
    if (estilosMarca[nombreMarca]) {
        const config = estilosMarca[nombreMarca];

        // A) Agregar la clase de color y la clase de texto blanco
        contenedor.classList.add(config.clase);
        contenedor.classList.add('marca-activa'); // Para poner letras blancas

        // B) Cambiar y mostrar el logo
        if (config.logo) {
            imgLogo.src = config.logo;
            imgLogo.style.display = 'block';
        }

    } else {
        // Si elige "Todas" o una sin logo, volvemos al neutro
        imgLogo.style.display = 'none';
        input.value = nombreMarca || "Seleccion√° una empresa";
    }
}
function cambiarValor(valor) {
    let input = document.getElementById('Operadora');
    if(input) {
        input.value = valor;
        actualizarVisualMarca(valor); 
    }
    
}

